import { StyleSheet } from '@react-pdf/renderer';

export const styles = StyleSheet.create({
  page: {
    padding: '10mm',
    fontFamily: 'NanumGothic',
    fontSize: 10,
  },
  header: {
    backgroundColor: '#f8f9fa',
    padding: '2mm',
    marginBottom: '5mm',
  },
  formNumber: {
    fontSize: 11,
  },
  title: {
    fontSize: 16,
    textAlign: 'center',
    marginBottom: '5mm',
    fontWeight: 'bold'
  },
  table: {
    width: '100%',
    border: '1pt solid black',
  },
  row: {
    flexDirection: 'row',
    borderBottom: '1pt solid black',
    minHeight: '8mm',
  },
  label: {
    width: '25%',
    borderRight: '1pt solid black',
    padding: '2mm',
    backgroundColor: '#f5f5f5'
  },
  value: {
    flex: 1,
    padding: '2mm',
  },
  checkboxRow: {
    flexDirection: 'row',
    padding: '2mm',
    gap: '5mm',
  }
});
